DROP TABLE IF EXISTS `catalog`;
CREATE TABLE `catalog` (
  `code` varchar(24) NOT NULL COMMENT '目录编码',
  `is_active` varchar(8) DEFAULT NULL COMMENT '是否使用',
  `change_from` varchar(24) DEFAULT NULL COMMENT '记录来源',
  `change_index` decimal(8,0) DEFAULT NULL,
  `change_number` decimal(8,0) DEFAULT NULL,
  `secret` decimal(4,0) DEFAULT NULL,
  `secrecy` decimal(4,0) DEFAULT NULL COMMENT '密级',
  `builder` varchar(64) DEFAULT NULL COMMENT '创建者',
  `owner` varchar(64) DEFAULT NULL,
  `start_date` decimal(15,0) DEFAULT NULL COMMENT '开始使用日期',
  `end_date` decimal(15,0) DEFAULT NULL COMMENT '结束使用日期',
  `buddle_id` varchar(64) DEFAULT NULL COMMENT '插件标识',
  `module_code` varchar(24) DEFAULT NULL COMMENT '模块编码',
  `identifier` varchar(64) DEFAULT NULL COMMENT '目录标识',
  `name` varchar(128) DEFAULT NULL COMMENT '目录名字',
  `type` varchar(24) DEFAULT NULL COMMENT '目录类型：function[功能接口]、fusion[融合服务]、buscollect[采集管道]、busflow[流转管道]、busshare[共享管道]、migration[迁移]、synchronization[同步]、indicator[指标服务]、proxy[代理服务]',
  `source_type` varchar(16) DEFAULT NULL COMMENT '来源类型，取值：weather（决策辅助）、rainbow（数据资产）、constellation（数字网络）、file_share（文件共享）',
  `status` varchar(16) DEFAULT NULL COMMENT '服务状态，取值：add（新建）、enable（正常）、debug（调试）、revise（修订）、disable（暂停使用）、exception（异常）、starting（启动中）',
  `latest_version` decimal(4,0) DEFAULT NULL COMMENT '最新已发布的版本号',
  `current_version` decimal(4,0) DEFAULT NULL COMMENT '当前操作版本号，用于记录当前正在调试或修订的版本号，如果存在调试或修订的版本号及状态，则默认展示这个版本的内容，以方便完成调试或修订',
  `issue_status` varchar(16) DEFAULT NULL COMMENT '下发状态，取值：none（未下发）、enable（启用下发）、disable（停用下发）',
  `issued_version` decimal(4,0) DEFAULT NULL COMMENT '已下发版本',
  `is_superior` varchar(8) DEFAULT NULL COMMENT '是否上级下发服务',
  `is_standard` varchar(8) DEFAULT NULL COMMENT '是否作为标准，取值：true、false',
  `standard_class_id` varchar(64) DEFAULT NULL COMMENT '标准分类标识，关联数据标准表的标识',
  `is_metadata` varchar(8) DEFAULT NULL,
  `is_exchange` varchar(8) DEFAULT NULL,
  `last_modify` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `run_type` varchar(64) DEFAULT NULL COMMENT '运行类型',
  `is_single` varchar(8) DEFAULT NULL,
  `is_init_data` varchar(8) DEFAULT NULL COMMENT '是否初始导入的功能，初始导入为true，否则为空或为false',
  `content_type` varchar(32) DEFAULT NULL COMMENT 'MIME类型',
  `response_encoding` varchar(32) DEFAULT NULL COMMENT '响应字符集，支持选择的值：UTF-16、UTF-8、GBK、GB18030、ISO-8859-1，默认值为空',
  `is_permit` varchar(8) DEFAULT NULL COMMENT '是否判断权限',
  `is_home` varchar(8) DEFAULT NULL COMMENT '是否应用入口',
  `is_running` varchar(8) DEFAULT NULL,
  `frequentness` varchar(8) DEFAULT NULL COMMENT 'year|年，month|月，day|天，hour|时，minute|分，second|秒',
  `interval_time` int DEFAULT NULL COMMENT '是否入口插件',
  `join_time` datetime DEFAULT NULL,
  `run_start_hour` varchar(8) DEFAULT NULL COMMENT '是否升级',
  `run_start_minute` varchar(8) DEFAULT NULL COMMENT '是否升级',
  `run_finish_hour` varchar(8) DEFAULT NULL COMMENT '是否升级',
  `run_finish_minute` varchar(8) DEFAULT NULL COMMENT '是否升级',
  `timing_year` varchar(128) DEFAULT NULL COMMENT '定时年',
  `timing_month` varchar(32) DEFAULT NULL COMMENT '定时年',
  `timing_day` varchar(128) DEFAULT NULL,
  `timing_hour` varchar(64) DEFAULT NULL,
  `timing_minute` varchar(180) DEFAULT NULL,
  `is_for_each` varchar(8) DEFAULT NULL,
  `is_log` varchar(8) DEFAULT NULL COMMENT '是否已同步总线',
  `connection_code` varchar(24) DEFAULT NULL,
  `description` varchar(256) DEFAULT NULL COMMENT '描述',
  `class` varchar(256) DEFAULT NULL COMMENT '处理类',
  `manual_file_id` varchar(64) DEFAULT NULL COMMENT '手册文件标识，对于开发类型的服务，需要手动上传接口手册，保存上传后返回的文件标识，用于下载时使用',
  `select_expression` varchar(1024) DEFAULT NULL,
  PRIMARY KEY (`code`),
  KEY `ak_key_2` (`buddle_id`,`identifier`),
  KEY `index_catalog` (`buddle_id`,`identifier`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3 COMMENT='catalog[功能目录]';

-- ----------------------------
-- Records of catalog
-- ----------------------------

